return $input.all().flatMap(({ json: c }) => {

  // 1. Group every leadsEnrichment[key] by its index (0,1,2…)
  const contacts = Object.keys(c).reduce((map, k) => {
    const m = k.match(/^leadsEnrichment\[(\d+)]\.(.+)$/);
    if (!m) return map;                             // skip company keys
    const [ , idx, field ] = m;                     // idx = '0', field = 'email'
    (map[idx] ??= {})[field] = c[k];
    return map;
  }, {});

  // 2. Convert map → array and enrich with the shared company data
  return Object.values(contacts)
    .filter(ct => Object.values(ct).some(v => v))   // drop completely empty rows
    .map(ct => ({
      title:        c.title,
      categoryName: c.categoryName,
      city:         c.city,
      street:       c.street,
      phone:        c.phone,
      website:      c.website,
      ...ct,                                        // fullName, email, linkedinProfile, jobTitle
    }));
}).map(json => ({ json }));

/**
 * n8n CODE NODE – Social-profile extractor
 * ----------------------------------------------------------
 * INPUT (per item) :  item.json.html   ← the full HTML / Markdown string
 * OUTPUT (per item):  {
 *   facebook : [...], instagram : [...],
 *   linkedin : [...], twitter   : [...],
 *   yelp     : [...], tiktok    : [...],
 *   youtube  : [...]
 * }
 */

const raw = String($input.item.json.html || $input.item.json.data?.markdown || '');

if (!raw) return { json: { error: 'No HTML/markdown provided' } };

/* ---------- helper ---------- */
const normalise = u =>
  u.replace(/^(?:https?:\/\/)?(?:www\.)?/i, 'https://www.')
   .split(/[?#]/)[0]
   .replace(/\/$/, '');

const unique = arr => [...new Set(arr)];

/* ---------- profile-only regexes ---------- */
const NET = {
  facebook : /https?:\/\/(?:www\.|m\.)?facebook\.com\/(?!share|sharer|plugins|dialog)[A-Za-z0-9._-]+\/?/ig,
  instagram: /https?:\/\/(?:www\.)?instagram\.com\/(?!share)[A-Za-z0-9._-]+\/?/ig,
  linkedin : /https?:\/\/(?:[\w-]+\.)?linkedin\.com\/(?:company|in|school)\/[A-Za-z0-9._-]+\/?/ig,
  twitter  : /https?:\/\/(?:www\.)?(?:twitter|x)\.com\/(?!intent|share)[A-Za-z0-9._-]+\/?/ig,
  yelp     : /https?:\/\/(?:www\.)?yelp\.com\/biz\/[A-Za-z0-9._-]+\/?/ig,
  tiktok   : /https?:\/\/(?:www\.)?tiktok\.com\/@[A-Za-z0-9._-]+\/?/ig,
  youtube  : /https?:\/\/(?:www\.)?youtube\.com\/(?:channel|user|c)\/[A-Za-z0-9._-]+\/?/ig
};

/* ---------- run extraction ---------- */
const output = {};
for (const [net, rex] of Object.entries(NET)) {
  const matches = [...raw.matchAll(rex)].map(m => normalise(m[0]));
  output[net] = unique(matches);
}

/* ---------- return ---------- */
return { json: output };
